const int INF = 1000000000;

struct ldzint {
    int twopow, fivpow;

    ldzint(): twopow(0), fivpow(0) {}

    ldzint(int x) : twopow(0), fivpow(0) {
        if(x == 0) {

            twopow = 1;
            fivpow = 1;
            return;
        }
        while(x % 2 == 0) {
            twopow++;
            x /= 2;
        }
        while(x % 5 == 0) {
            fivpow++;
            x /= 5;
        }
    }

    ldzint(int a, int b): twopow(a), fivpow(b) {}

    int get() const {
        return min(twopow, fivpow);
    }

    ldzint operator*(const ldzint &other) const {
        return ldzint(twopow + other.twopow, fivpow + other.fivpow);
    }
};

ldzint min_ldzint(const ldzint &a, const ldzint &b) {
    if(a.get() < b.get()) return a;
    return b;
}

int mat[1005][1005];
ldzint dp[1005][1005];

int main(){
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int n;
    cin >> n;
    bool nonzero = false;
    for(int i = 1; i <= n; i++){
        for(int j = 1; j <= n; j++){
            cin >> mat[i][j];
            if(mat[i][j] == 0)
                nonzero = true;
        }
    }

    for (int i = 0; i <= n; i++){
        for(int j = 0; j <= n; j++){
            dp[i][j] = ldzint(INF, INF);
        }
    }

    dp[1][1] = ldzint(mat[1][1]);

    for(int i = 1; i <= n; i++){
        for(int j = 1; j <= n; j++){
            if(i == 1 && j == 1) continue;
            ldzint up  = ldzint(INF, INF);
            ldzint left = ldzint(INF, INF);
            if(i > 1)
                up = dp[i-1][j];
            if(j > 1)
                left = dp[i][j-1];

            ldzint best = min_ldzint(up, left);
            dp[i][j] = best * ldzint(mat[i][j]);
        }
    }

    int ans = dp[n][n].get();

    if(nonzero && ans > 1)
        ans = 1;
    cout << ans;
    return 0;
}